  html: "\r\n\t\t\t<!-- BEGIN TEMPLATE: ad_showthread_firstpost_start -->\n\n<!-- END TEMPLATE: ad_showthread_firstpost_start -->\r\n\t\t\t<!-- BEGIN TEMPLATE: bbcode_quote -->\n<div style=\"margin:20px; margin-top:5px; \">\r\n\t<div class=\"smallfont\" style=\"margin-bottom:2px\">Quote:</div>\r\n\t<table cellpadding=\"6\" cellspacing=\"0\" border=\"0\" width=\"100%\" class=\"voz-bbcode-quote\">\r\n\t<tr>\r\n\t\t<td class=\"alt2\" style=\"border:1px inset\">\r\n\t\t\t\r\n\t\t\t\t<div>\r\n\t\t\t\t\tOriginally Posted by <strong>IsuckInternet</strong>\r\n\t\t\t\t\t<a href=\"showthread.php?p=32302480#post32302480\" rel=\"nofollow\"><img class=\"inlineimg\" src=\"images/buttons/viewpost.gif\" border=\"0\" alt=\"View Post\"></a>\r\n\t\t\t\t</div>\r\n\t\t\t\t<div style=\"font-style:italic\">gi&#xE1;n &#x111;i&#x1EC7;p li&#xEA;n x&#xF4; n&#x1EB1;m v&#xF9;ng &#x111;&#xE3; post &#x1EA3;nh em huy&#x1EC1;n tho&#x1EA1;i c&#x1EE7;a m&#xEC;nh l&#xEA;n 4rum &#x111;&#xF3;. May qu&#xE1; ko ph&#x1EA3;i ng&#x1B0;&#x1EDD;i quen, nh&#x1B0;ng c&#x169;ng c&#x1EA3;m th&#x1EA5;y c&#xF3; l&#x1ED7;i v&#x1EDB;i em &#xFD;.....<br>\r\nTuy&#xEA;n b&#x1ED1; t&#x1EEB; gi&#x1EDD; ko post &#x1EA3;nh g&#xE1;i &#x1EDF; &#x111;&#xE2;y n&#x1EEF;a, 1 ng&#xE0;y b&#x1EA1;n b&#xE8; nh&#xEC;n th&#x1EA5;y &#x1EA3;nh m&#xEC;nh ch&#x1EE5;p n&#xF3; &#x1EDF; b&#xEA;n li&#xEA;n x&#xF4; ch&#x1EA5;m m&#x1EF9; th&#xEC; nh&#x1EE5;c.</div>\r\n\t\t\t\r\n\t\t</td>\r\n\t</tr>\r\n\t</table>\r\n</div>\n<!-- END TEMPLATE: bbcode_quote -->H&#x1ECF;i ngay NooPhuocThinh location nguy hi&#x1EC3;m <img src=\"/images/smilies/Off/surrender.gif\" border=\"0\" alt=\"\" title=\"Surrender\" class=\"inlineimg\"><img src=\"/images/smilies/Off/canny.gif\" border=\"0\" alt=\"\" title=\"Canny\" class=\"inlineimg\">\r\n\t\t"
  text: "Quote:\r\n\t\r\n\t\r\n\t\t\r\n\t\t\t\r\n\t\t\t\t\r\n\t\t\t\t\tOriginally Posted by IsuckInternet\r\n\t\t\t\t\t\r\n\t\t\t\t\r\n\t\t\t\tgián điệp liên xô nằm vùng đã post ảnh em huyền thoại của mình lên 4rum đó. May quá ko phải người quen, nhưng cũng cảm thấy có lỗi với em ý.....\r\nTuyên bố từ giờ ko post ảnh gái ở đây nữa, 1 ngày bạn bè nhìn thấy ảnh mình chụp nó ở bên liên xô chấm mỹ thì nhục.\r\n\t\t\t\r\n\t\t\r\n\t\r\n\t\r\n\nHỏi ngay NooPhuocThinh location nguy hiểm"
